  return (
    <Grid container justify="space-between" alignItems="center">
      {props.store.animalsReducer.map((animal, i) =>
      <Grid item xs={4}>
      <Grid container key={i} >
        <Grid item><img style={{height: '50%', weight: '50%'}} src={animal.picture} /></Grid>
        <Grid item>{animal.name}</Grid>
        <Grid item>{animal.age}</Grid>
        <Grid item>{animal.name}</Grid>
      </Grid>
      </Grid>
      )}
    </Grid>
  );
}

export default connect(mapStoreToProps)(AdoptionSection);
